def my_func(input1:str):
    if len(input1) < 1 or len(input1) > 20:
        raise ValueError("Input string must be between 1 and 20 characters long")
    words = input1.split()
    processed_words = []
    for word in words:
        parts = word.split('-')
        transformed_word = parts[0] + ''.join(part.capitalize() for part in parts[1:])
        processed_words.append(transformed_word)
    return ' '.join(processed_words)
